(26, 'PHP Questions and Answers', 'fresher', '<p>Which command can be executed by a user who is already logged into the system, in order to change to the root user? (type the command without any parameters)<br />\r\n&nbsp;</p>\r\n', '<p>su<br />\r\n&nbsp;</p>\r\n', '<p>&nbsp;root<br />\r\n&nbsp;</p>\r\n', '<p>&nbsp;chroot<br />\r\n&nbsp;</p>\r\n', '<p>&nbsp;user</p>\r\n', '2', '1'),
(27, 'LINUX DEBUGGING', 'fresher', '<p>&nbsp;A user issues the following command sequence:<br />\r\n$ a.out &amp;<br />\r\n$ bash<br />\r\n$ a.out &amp;<br />\r\nIf the user kills the bash process, then which of the following is true?<br />\r\n&nbsp;</p>\r\n', '<p>a) The second a.out process is also terminated<br />\r\n&nbsp;</p>\r\n', '<p>b) The second a.out process becomes a defunct process<br />\r\n&nbsp;</p>\r\n', '<p>c) The first a.out process becomes a zombie process<br />\r\n&nbsp;</p>\r\n', '<p>d) init process becomes parent of second a.out process</p>\r\n', '3', '1'),
(28, 'LINUX DEBUGGING', 'fresher', '<p>nohup is used to<br />\r\n&nbsp;</p>\r\n', '<p>a) automatically hang up the process after logout<br />\r\n&nbsp;</p>\r\n', '<p>b) continue the process after logout<br />\r\n&nbsp;</p>\r\n', '<p>c) create backgroung process<br />\r\n&nbsp;</p>\r\n', '<p>d) manually hang up the process after logout</p>\r\n', '4', '1'),
(29, 'LINUX DEBUGGING', 'fresher', '<p>we can change the priority of a running process using<br />\r\n&nbsp;</p>\r\n', '<p>(a) nice<br />\r\n&nbsp;</p>\r\n', '<p>(b) renice<br />\r\n&nbsp;</p>\r\n', '<p>(c) priority cannot be changed for a running process<br />\r\n&nbsp;</p>\r\n', '<p>(d) only superuser can change the priority</p>\r\n', '3', '1'),
(30, 'LINUX DEBUGGING', 'fresher', '<p>The persistancy of a FIFO is<br />\r\n&nbsp;</p>\r\n', '<p>a) process &nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n&nbsp;</p>\r\n', '<p>b) kernel&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n&nbsp;</p>\r\n', '<p>c) file system &nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n&nbsp;</p>\r\n', '<p>d) none</p>\r\n', '4', '1'),
(31, 'LINUX DEBUGGING', 'fresher', '<p>The persistancy of a FIFO is<br />\r\n&nbsp;</p>\r\n', '<p>a) process &nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n&nbsp;</p>\r\n', '<p>b) kernel&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n&nbsp;</p>\r\n', '<p>c) file system &nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n&nbsp;</p>\r\n', '<p>d) none</p>\r\n', '4', '1'),
(32, 'LINUX DEBUGGING', 'fresher', '<p>Which one of the following is not system V IPC ?<br />\r\n&nbsp;</p>\r\n', '<p>a) Shared Memory<br />\r\n&nbsp;</p>\r\n', '<p>b) Semaphores<br />\r\n&nbsp;</p>\r\n', '<p>c) FIFO<br />\r\n&nbsp;</p>\r\n', '<p>d) Message Queues</p>\r\n', '1', '1'),
(33, 'LINUX DEBUGGING', 'fresher', '<p>&nbsp;Which is not the correct option for removing a message queue<br />\r\n&nbsp;</p>\r\n', '<p>a) ipcrm -Q<br />\r\n&nbsp;</p>\r\n', '<p>b) ipcrm -q<br />\r\n&nbsp;</p>\r\n', '<p>c) ipcrm -m<br />\r\n&nbsp;</p>\r\n', '<p>d) None</p>\r\n', '3', '1'),
(34, 'LINUX DEBUGGING', 'experienced2-4', '<p>1. What is the job of -Werror option in gcc?<br />\r\n&nbsp;</p>\r\n', '<p>a) it avoids all the errors present in the source code<br />\r\n&nbsp;</p>\r\n', '<p>b) it makes all warnings into errors<br />\r\n&nbsp;</p>\r\n', '<p>c) it stores all the errors of source code into a seperate file<br />\r\n&nbsp;</p>\r\n', '<p>d) none of the mentioned</p>\r\n', '3', '2'),
(35, 'LINUX DEBUGGING', 'experienced2-4', '<p>he command &ldquo;as -o sanfoundry.o sanfoundry.s&rdquo; will<br />\r\n&nbsp;</p>\r\n', '<p>a) generate object file sanfoundry.o<br />\r\n&nbsp;</p>\r\n', '<p>b) provide an error if sanfoundry.s exists<br />\r\n&nbsp;</p>\r\n', '<p>c) both (a) and (b)<br />\r\n&nbsp;</p>\r\n', '<p>d) none of the mentioned</p>\r\n', '2', '2'),
(36, 'LINUX DEBUGGING', 'experienced2-4', '<p>The -H option of gcc<br />\r\n&nbsp;</p>\r\n', '<p>a) prints the name of each header file used<br />\r\n&nbsp;</p>\r\n', '<p>b) is used to include header file<br />\r\n&nbsp;</p>\r\n', '<p>c) ignores the header file which are not required by source code<br />\r\n&nbsp;</p>\r\n', '<p>d) none of the mentioned</p>\r\n', '4', '2'),
(37, 'LINUX DEBUGGING', 'experienced2-4', '<p>The -fPIC option of gcc<br />\r\n&nbsp;</p>\r\n', '<p>a) generates the position independent code of shared libraries<br />\r\n&nbsp;</p>\r\n', '<p>b) opens the source file in readonly mode<br />\r\n&nbsp;</p>\r\n', '<p>c) both (a) and (b)<br />\r\n&nbsp;</p>\r\n', '<p>d) none of the mentioned</p>\r\n', '2', '2'),
(38, 'LINUX DEBUGGING', 'experienced2-4', '<p>Which option of gcc links with a library file?<br />\r\n&nbsp;</p>\r\n', '<p>a) -l<br />\r\n&nbsp;</p>\r\n', '<p>b) -L<br />\r\n&nbsp;</p>\r\n', '<p>c) -link<br />\r\n&nbsp;</p>\r\n', '<p>d) none of the mentioned</p>\r\n', '3', '2'),
(39, 'LINUX DEBUGGING', 'experienced2-4', '<p>When a program is linked with a shared library<br />\r\n&nbsp;</p>\r\n', '<p>a) only a small table is created in the executable<br />\r\n&nbsp;</p>\r\n', '<p>b) executable contains the whole content of respective .so file<br />\r\n&nbsp;</p>\r\n', '<p>c) executable contains nothing related with the shared libraries<br />\r\n<br />\r\n&nbsp;</p>\r\n', '<p>d) none of the mentioned</p>\r\n', '4', '2'),
(40, 'LINUX DEBUGGING', 'experienced2-4', '<p>. Shared libraries can be shared between<br />\r\n&nbsp;</p>\r\n', '<p>a) various running programs<br />\r\n&nbsp;</p>\r\n', '<p>b) only 2 running programs<br />\r\n&nbsp;</p>\r\n', '<p>c) only 8 running programs<br />\r\n&nbsp;</p>\r\n', '<p>d) none of the mentioned<br />\r\n&nbsp;</p>\r\n', '3', '2'),
(41, 'LINUX DEBUGGING', 'experienced2-4', '<p>For a shared library, version number is changed when<br />\r\n&nbsp;</p>\r\n', '<p>a) changes done in code make the shared library incompatible with the previous version<br />\r\n&nbsp;</p>\r\n', '<p>b) changes done in code does not make the shared library incompatible with the previous version<br />\r\n&nbsp;</p>\r\n', '<p>c) when minor number is changed<br />\r\n&nbsp;</p>\r\n', '<p>d) none of the mentioned</p>\r\n', '3', '2');

